import{_get as e}from"../_modules/get/get.min.js";async function getMatches(){var t=document.getElementById("allmatch").checked?"all":"team",a=document.getElementById("eventCode").value;e(`/api/matches/2023/${a}/qual/${t}`,"viewMatchButton").then(e=>{var t="";for(let m=0;m<e.Schedule.length;m++)t+=`<fieldset><label>${e.Schedule[m].description}<br>${e.Schedule[m].startTime.replace("T"," ")}</label><br><span style="color: #FF4000;"><a href="browse?number=${e.Schedule[m].teams[0].teamNumber}&type=team&event=${a}">${e.Schedule[m].teams[0].teamNumber}</a>&emsp;<a href="browse?number=${e.Schedule[m].teams[1].teamNumber}&type=team&event=${a}">${e.Schedule[m].teams[1].teamNumber}</a>&emsp;<a href="browse?number=${e.Schedule[m].teams[2].teamNumber}&type=team&event=${a}">${e.Schedule[m].teams[2].teamNumber}</a></span><br><span style="color: #00BFFF;"><a href="browse?number=${e.Schedule[m].teams[3].teamNumber}&type=team&event=${a}">${e.Schedule[m].teams[3].teamNumber}</a>&emsp;<a href="browse?number=${e.Schedule[m].teams[4].teamNumber}&type=team&event=${a}">${e.Schedule[m].teams[4].teamNumber}</a>&emsp;<a href="browse?number=${e.Schedule[m].teams[5].teamNumber}&type=team&event=${a}">${e.Schedule[m].teams[5].teamNumber}</a></span></fieldset>`;document.getElementById("matchHeader").insertAdjacentHTML("afterend",t),document.getElementById("search").style.display="none",document.getElementById("results").style.display="flex",document.getElementById("viewMatchButton").innerHTML="View"}).catch(e=>console.log(e))}window.getMatches=getMatches;